// Appends related to o.R.Assignments.
// Sets related.R.Frontend appropriately.
func (o *Frontend) AddAssignments(ctx context.Context, exec boil.ContextExecutor, insert bool, related ...*Assignment) error {
	var err error
	for _, rel := range related {
		if insert {
			queries.Assign(&rel.FrontendID, o.FrontendID)
			if err = rel.Insert(ctx, exec, boil.Infer()); err != nil {
				return errors.Wrap(err, "failed to insert into foreign table")
			}
		} else {
			updateQuery := fmt.Sprintf(
				"UPDATE \"assignments\" SET %s WHERE %s",
				strmangle.SetParamNames("\"", "\"", 1, []string{"frontend_id"}),
				strmangle.WhereClause("\"", "\"", 2, assignmentPrimaryKeyColumns),
			)
			values := []interface{}{o.FrontendID, rel.AssignmentID}

			if boil.IsDebug(ctx) {
				writer := boil.DebugWriterFrom(ctx)
				fmt.Fprintln(writer, updateQuery)
				fmt.Fprintln(writer, values)
			}
			if _, err = exec.ExecContext(ctx, updateQuery, values...); err != nil {
				return errors.Wrap(err, "failed to update foreign table")
			}

			queries.Assign(&rel.FrontendID, o.FrontendID)
		}
	}

	if o.R == nil {
		o.R = &frontendR{
			Assignments: related,
		}
	} else {
		o.R.Assignments = append(o.R.Assignments, related...)
	}

	for _, rel := range related {
		if rel.R == nil {
			rel.R = &assignmentR{
				Frontend: o,
			}
		} else {
			rel.R.Frontend = o
		}
	}
	return nil
}

// SetAssignments removes all previously related items of the
// frontend replacing them completely with the passed
// in related items, optionally inserting them as new records.
// Sets o.R.Frontend's Assignments accordingly.
// Replaces o.R.Assignments with related.
// Sets related.R.Frontend's Assignments accordingly.
func (o *Frontend) SetAssignments(ctx context.Context, exec boil.ContextExecutor, insert bool, related ...*Assignment) error {
	query := "update \"assignments\" set \"frontend_id\" = null where \"frontend_id\" = $1"
	values := []interface{}{o.FrontendID}
	if boil.IsDebug(ctx) {
		writer := boil.DebugWriterFrom(ctx)
		fmt.Fprintln(writer, query)
		fmt.Fprintln(writer, values)
	}
	_, err := exec.ExecContext(ctx, query, values...)
	if err != nil {
		return errors.Wrap(err, "failed to remove relationships before set")
	}

	if o.R != nil {
		for _, rel := range o.R.Assignments {
			queries.SetScanner(&rel.FrontendID, nil)
			if rel.R == nil {
				continue
			}

			rel.R.Frontend = nil
		}
		o.R.Assignments = nil
	}

	return o.AddAssignments(ctx, exec, insert, related...)
}

// RemoveAssignments relationships from objects passed in.
// Removes related items from R.Assignments (uses pointer comparison, removal does not keep order)
// Sets related.R.Frontend.
func (o *Frontend) RemoveAssignments(ctx context.Context, exec boil.ContextExecutor, related ...*Assignment) error {
	if len(related) == 0 {
		return nil
	}

	var err error
	for _, rel := range related {
		queries.SetScanner(&rel.FrontendID, nil)
		if rel.R != nil {
			rel.R.Frontend = nil
		}
		if _, err = rel.Update(ctx, exec, boil.Whitelist("frontend_id")); err != nil {
			return err
		}
	}
	if o.R == nil {
		return nil
	}

	for _, rel := range related {
		for i, ri := range o.R.Assignments {
			if rel != ri {
				continue
			}

			ln := len(o.R.Assignments)
			if ln > 1 && i < ln-1 {
				o.R.Assignments[i] = o.R.Assignments[ln-1]
			}
			o.R.Assignments = o.R.Assignments[:ln-1]
			break
		}
	}

	return nil
}

// Frontends retrieves all the records using an executor.
func Frontends(mods ...qm.QueryMod) frontendQuery {
	mods = append(mods, qm.From("\"frontends\""), qmhelper.WhereIsNull("\"frontends\".\"deleted_at\""))
	q := NewQuery(mods...)
	if len(queries.GetSelect(q)) == 0 {
		queries.SetSelect(q, []string{"\"frontends\".*"})
	}

	return frontendQuery{q}
}

// FindFrontend retrieves a single record by ID with an executor.
// If selectCols is empty Find will return all columns.
func FindFrontend(ctx context.Context, exec boil.ContextExecutor, frontendID string, selectCols ...string) (*Frontend, error) {
	frontendObj := &Frontend{}

	sel := "*"
	if len(selectCols) > 0 {
		sel = strings.Join(strmangle.IdentQuoteSlice(dialect.LQ, dialect.RQ, selectCols), ",")
	}
	query := fmt.Sprintf(
		"select %s from \"frontends\" where \"frontend_id\"=$1 and \"deleted_at\" is null", sel,
	)

	q := queries.Raw(query, frontendID)

	err := q.Bind(ctx, exec, frontendObj)
	if err != nil {
		if errors.Is(err, sql.ErrNoRows) {
			return nil, sql.ErrNoRows
		}
		return nil, errors.Wrap(err, "models: unable to select from frontends")
	}

	if err = frontendObj.doAfterSelectHooks(ctx, exec); err != nil {
		return frontendObj, err
	}

	return frontendObj, nil
}

